com.mirth.connect.plugins.javascriptrule.script:
// Looking for Hospital Medical Record Number HMRN in the patinetId list //
for each (patientIdentifier in msg['PID']['PID.3']) {
	if (patientIdentifier['PID.3.4'].toString() == 'HMRN') {
		var patientHMRN = '' + patientIdentifier['PID.3.1'].toString();
	}
}

// Patient name //
var patientName = '' + msg['PID']['PID.5']['PID.5.2'].toString();

// Patient familyname //
var patientFamilyName = '' + msg['PID']['PID.5']['PID.5.1'].toString();

// Patient Date of birth //
var patientDOB = '' + msg['PID']['PID.7']['PID.7.1'].toString();

if ((patientHMRN.length == 0) || (patientName.length == 0) || (patientFamilyName.length == 0) || (patientDOB.length == 0)) {
	return false;
} else {
	connectorMap.put('patientHMRN',patientHMRN);
	connectorMap.put('patientName',patientName);
	connectorMap.put('patientFamilyName',patientFamilyName);
	connectorMap.put('patientDOB',patientDOB);
	return true;
}

