properties.code:
/*                     Delay function                    */
/*                                                       */
/* Stops execution during a number of milliseconds:      */
/*   @param {String} delay : milliseconds to wait.       */
/*                                                       */

function dummySleep(delay)
{
	var start = new Date().getTime();
	while (new Date().getTime() < start + delay);
}

/*                         END                           */

